import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import Top from './Top';
// import Game from './Game';
// import About from './About';
// import Works from './Works';
// import History from './History';

const Header = (props)=>{
    return(
        <>
            <header className="header container">
                <Link to="/"><h1>takashima takuto</h1></Link>
                <nav className="headerNav">
                    <ul className="headerNavLIst">
                        {/* <Router> */}
                            <li className="headerNavItem"><Link className="headerNavLink" to="/"><FontAwesomeIcon icon={['fas', "home"]} />top</Link></li>
                            <li className="headerNavItem"><Link className="headerNavLink" to="/game"><FontAwesomeIcon icon={['fas', 'minus-circle']} />game</Link></li>
                            <li className="headerNavItem"><Link className="headerNavLink" to="/about/"><FontAwesomeIcon icon={['far', "address-card"]} />about</Link></li>
                            <li className="headerNavItem"><Link className="headerNavLink" to="/works/"><FontAwesomeIcon icon={['fas', ""]} />works</Link></li>
                            <li className="headerNavItem"><Link className="headerNavLink" to="/history/"><FontAwesomeIcon icon={['fas', "book"]} />History</Link></li>
                            <li className="headerNavItem"><Link className="headerNavLink" to="/contact/">()contact</Link></li>
                        {/* </Router> */}
                    </ul>
                </nav>
            </header>
        </>
    )
}


export default Header;
